class Particle{
    constructor(x,y){
        this.x = x;
        this.y = y;
        this.size = 1;

        // Posição inicial da partícula:
        this.baseX = this.x; 
        this.baseY = this.y;

        this.position1 = Math.floor((this.x/multiplier - adjustX)*resolution);
        this.position2 = Math.floor((this.y/multiplier - adjustY)*resolution);

        this.density = (Math.random()*40) +5;
    }
    draw(){
        //  if((mappedImage[this.position1])&&(mappedImage[this.position1][this.position2])){
        //     ctx.fillStyle = mappedImage[this.position1][this.position2][1];
        //     console.log("Encontrou posição no MappedImage Array");
        //  };
        ctx.fillStyle = gradient1;
        //ctx.fillStyle = 'gray';

        // Desenhar partícula:
        ctx.beginPath();
        ctx.arc(this.x, this.y, this.size, 0 , Math.PI*2);
        ctx.closePath();
        ctx.fill();
    }
    update(){
        let dx = mouse.x - this.x;
        let dy = mouse.y - this.y;
        let distance = Math.sqrt(dx*dx + dy*dy);
        let forceDirectionX = dx/distance;
        let forceDirectionY = dy/distance;
        let maxDistance = mouse.radius;

        // A força será proposrcional a distancia que a partícula está do Mouse.
        // Se estiver na distancia máxima, a força é zero. Se estiver muito perto, a força aumenta.
        let force = (maxDistance-distance)/maxDistance;

        let directionX = forceDirectionX*force*this.density;
        let directionY = forceDirectionY*force*this.density;

        if (distance < maxDistance){
            // Se a partícula está no alcance de interação do mouse, ela será empurrada para longe com um valor que depende da distancia do mouse.
            this.x -= directionX;
            this.y -= directionY;
        } else {
            // Se a partícula está fora do alcance de interação do mouse, ela voltará para a posição inicial aos pouquinhos.
            if(this.x !== this.baseX){
                let dx = this.x - this.baseX;
                this.x -= dx/10;
            }
            if(this.y !== this.baseY){
                let dy = this.y - this.baseY;
                this.y -= dy/10;
            }
        };
    }
};

